function App() {
  return (
<>
    <header>
      <a href="/">Главная</a>
      <a href="/products">Товары</a>
    </header>
    <Routes>
      <Route path="/" element={<Main />}/>
      <Route path="/Products" element={<Products />}/>
    </Routes>
</>
  );
}

export default App;
